import {useState} from 'react';
import './App.css';
import DrawableCanvas from 'react-drawable-canvas';

function App() {
  const[state, setState] = useState({
    brushColor: '#800909',
    lineWidth: 4,
    canvasStyle: {
      backgroundColor: '#00FFDC'
    },
    clear: false
  });

  return (
    <div className="App">
      <DrawableCanvas {...state}/>
    </div>
  );
}

export default App;
